  return (
    <ReactTypingEffect text="Somewhere on earth, about 65.2 milion years ago..." />
  );
};

export default class IntroText extends Component {
  constructor(props) {
    super(props);
    this.state = { logo_img: props.logo_img, theme_color: props.theme_color };
  }
  render() {
    return (
      <div className="intro">
        <div className="textIntro">{ReactTypingEffectDemo()}</div>
      </div>
    );
  }
}
